import React from "react";

const Japan = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12 text-center">
          <h1>Japan Vlogs</h1>
          <p>
            journey begins: <del>June 25th 2020</del> TBDz
          </p>
        </div>
      </div>
    </div>
  );
};

export default Japan;
